import menu from './vi-VN/menu';
import globalHeader from './vi-VN/globalHeader';

export default {
    'login.login': 'Đăng nhập',
    'login.email': 'Email',
    'login.password': 'Mật khẩu',
    'login.register': 'Đăng kí',
    'login.loginMethod': 'Đăng nhập với',
    ...menu,
    ...globalHeader
}
